import Nav from "react-bootstrap/Nav";
import Tab from "react-bootstrap/Tab";
import { MobileNav } from "./MobileNav";
import { BiSearchAlt } from "react-icons/bi";

// api
let userImg = "https://source.unsplash.com/random/500x500/?face";
let userImg2 = "https://source.unsplash.com/random/500x500/?cute,girl";
let userName = "Alissa richards";
let userName2 = "Steven Jury";
let userLastTime = "02:32 am";

const NavLinkTab = () => {
  const NavLinkTabData = [
    {
      userName: userName,
      userImg: userImg,
      UserStatus: "typeing",
      userLastTime: userLastTime,
      userTotleMessage: "10",
      eventKey: "first",
    },
    {
      userName: userName2,
      userImg: userImg2,
      UserStatus: "typeing",
      userLastTime: userLastTime,
      userTotleMessage: "14",
      eventKey: "first2",
    },
  ];
  const NavLinkTabApp = (props) => {
    return (
      <>
        <Nav.Link eventKey={props.eventKey}>
          <ChatLitUi
            userName={props.userName}
            userImg={props.userImg}
            UserStatus={props.UserStatus}
            userLastTime={props.userLastTime}
            userTotleMessage={props.userTotleMessage}
          />
        </Nav.Link>
      </>
    );
  };
  return (
    <>
      {NavLinkTabData.map((val, i) => {
        return <NavLinkTabApp key={i} {...val} />;
      })}
    </>
  );
};
const TabPane = () => {
  const TabPaneData = [
    {
      eventKey: "first",
      userImg: userImg,
      userName: userName,
      UserStatus: "online",
      userLastTime: userLastTime,
    },
    {
      eventKey: "first2",
      userImg: userImg2,
      userName: userName2,
      UserStatus: "online",
      userLastTime: userLastTime,
    },
  ];
  const TabPaneApp = (props) => {
    return (
      <>
        <Tab.Pane eventKey={props.eventKey}>
          <MessigeChatUi
            userImg={props.userImg}
            userName={props.userName}
            UserStatus={props.UserStatus}
            userLastTime={props.userLastTime}
          />
        </Tab.Pane>
      </>
    );
  };
  return (
    <>
      {TabPaneData.map((val, i) => {
        return <TabPaneApp key={i} {...val} />;
      })}
    </>
  );
};

export const Chat = (props) => {
  return (
    <>
      <div className="chat_div">
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <div className="row">
            <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-12 col-sm-12 col-12">
